import { createSlice, createAsyncThunk } from '@reduxjs/toolkit';
import axios from 'axios';

const initialState = {
  properties: [],
  status: 'idle',
  error: null,
};

// Async thunk to fetch properties
// export const fetchProperties = createAsyncThunk(
//   'rental/fetchProperties',
//   async () => {
//     const response = await axios.get('http://192.168.29.226:2000/api/getAllAdds');
//     console.log("data",response.data.addv); 
//     return response.data.addv;
//   }
// );
export const getSocietiesByAdvertisements = createAsyncThunk(
  'rental/getSocietiesByAdvertisements',
  async () => {
    const response = await axios.get('http://192.168.29.226:2000/api/getSocietiesByAdvertisements');
    console.log("data", response.data);
    return response.data;
  }
);

const rentalSlice = createSlice({
  name: 'rental',
  initialState,
  reducers: {
  },
  extraReducers: (builder) => {
    builder
      .addCase(getSocietiesByAdvertisements.pending, (state) => {
        state.status = 'loading';
      })
      .addCase(getSocietiesByAdvertisements.fulfilled, (state, action) => {
        state.status = 'succeeded';
        console.log('succeeded', action.payload)
        state.properties = action.payload;
      })
      .addCase(getSocietiesByAdvertisements.rejected, (state, action) => {
        state.status = 'failed';
        console.log('failed', action.payload)
        state.error = action.error.message || 'Failed to fetch properties';
      });
  },
});

export default rentalSlice.reducer;
